import React  from "react"

const Table = (props) => {
  const title  = props.tableName;
  const data   = props.details[title];
  const header = Object.keys(data[0])
                .map(values => <th> {values}</th>);
  const rows = Object.values(data)
               .map((values, pos) => {
                    <tr>
                        <td> {pos + 1} </td>
                        {header.map(x => <td>{values[x]}</td>)}
                    </tr>
                })
  return (
    <div>
        <table>
            <tr>
                <th> # </th>
                {header}
            </tr>
        </table>
    </div>
)

} 

export default Table;
